import React, { Component } from "react";

import "../../styles/SessionQueue.css";

class SessionQueue extends Component {
  state = {
    queue: [
      {
        songTitle: "Ghost Voices",
        artist: "Virtual Self",
        albumImgURL: "../../resources/images/GhostVoices.png",
      },
      {
        songTitle: "Dosas and Mimosas",
        artist: "Cherub",
        albumImgURL: "../../resources/images/DosasandMimosas.png",
      },
    ],
  };
  render() {
    return <div className="queueDiv"></div>;
  }
}

export default SessionQueue;
